im = scan2im(s(1,:));
%subplot(1,2,1),imagesc(im)

im2 = scan2im(s(2,:));
%subplot(1,2,2),imagesc(im2)
%imshowpair(im,im2,'montage')

tformEstimate = imregcorr(im2,im);
Rfixed = imref2d(size(im));
im3 = imwarp(im2,tformEstimate,'OutputView',Rfixed);

%imshowpair(im,im3,'montage')

se = strel('disk',7);
im = imdilate(im,se);
im3 = imdilate(im3,se);
%imshow(im.*im3)

figure
im = scan2im(s(1,:));
im2 = scan2im(s(2,:));
tformEstimate = imregcorr(im2,im);
Rfixed = imref2d(size(im));
im2f = imwarp(im2,tformEstimate,'OutputView',Rfixed);
imshowpair(im,im2f,'montage')

figure
im3 = scan2im(s(3,:));
tformEstimate = imregcorr(im3,im);
Rfixed = imref2d(size(im));
im3f = imwarp(im3,tformEstimate,'OutputView',Rfixed);
imshowpair(im,im3f,'montage')

figure
merge = (double(im)+double(im2f)+double(im3f))/3;
imshow(merge)

